import Card from "../UI/Card"
import classes from "./UsersList.module.css";

const Totals = props => {


    return (
        <div>
            <Card className={classes.users}>
            <ul>
                <li>BTC total:</li>
                <li>ETH total:</li>
                <li>ADA total:</li>
                <li>BSC total:</li>

            </ul>
            </Card>
        </div>
    )


};

export default Totals;
